import React from 'react';
import styles from './cards.module.css';

function Cards(props) {
  const { cards } = props;

  const cardList = cards.filter(card => card.name)

  return (
    <div className={styles.inline}>
      {cardList.map(card => 
      <div key={card.id} >
        <img src={card.img} alt="logo" />
        <h1>{card.name}</h1>
        <ul>
          <li>{card.desc}</li>
          <li>{card.price}</li>
        </ul>
       </div>)}
    </div>
  );
}

export default Cards;
